        list.push(<a> <Merkmal href="#" onClick={handleClick}>Merkmal</Merkmal> </a>);

     return list;
 }



 return(

     <div class = "scrollMenu" >
        <script>
            handleClick();
        </script>
     </div>
     );

}

export default Selection;
